import React from "react";
import { Link } from "react-router-dom";

const BlogSection = () => {
	return (
		<div className="container blog-section my-8">
			<Link to="/">
				<div class="card">
					<img class="card-img-top" src="/images/lmj008.jpg" alt="LMJ" />
					<div class="card-body">
                        <h6 className="text-secondary mb-2">POLITICS</h6>
						<h4 class="card-title text-primary">This is the heading</h4>
						<p class="card-text text-dark">
							Lorem ipsum dolor sit amet consectetur adipisicing elit. Deleniti necessitatibus fugiat veniam cum commodi
							voluptates vero consequatur, facilis a accusantium...
						</p>
					</div>
					<div className="card-footer text-muted border-0 bg-transparent">
						<span>
							<i className="fa fa-clock-o"></i> November 13, 2020
						</span>
					</div>
				</div>
			</Link>
		</div>
	);
};

export default BlogSection;
